            <div class="top-block__label">«Ольга Вузова» 3 сезон</div>
            <div class="top-block__title">улыбаемся
                <br>и пашем!</div>
            <div class="top-block__text">Тебе все еще кажется, что аграрии — это те, кто день и ночь изучает колосья и тракторы? Как бы не так! Будущее здесь уже наступило. В аграрной сфере давно нет места стереотипам. Зато есть — драйву, высоким технологиям и карьере мечты.</div>
